      "name": "Celular Smartphone Samsung Galaxy A52 6gb 128gb Blanco Cuota",
      "price": null,
      "condition": "Nuevo",
      "description": "<p>CELULAR SMARTPHONE 6,5\" SAMSUNG GALAXY A52 ANDROID 11</p><p>6 GB / 128 GB / 64 MPx</p><p>SM-A525MZKEARO (Awesome black)</p><p>SM-A525MZWEARO (Awesome white)</p><br><p>PANTALLA ASOMBROSA, DESPLAZAMIENTO EXTRAFLUIDO</p><p>Disfrutá de los detalles realmente vibrantes con la pantalla Super AMOLED Display FHD+, que alcanza los 800 nits para mayor claridad, incluso con la luz de día brillante. Eye Comfort Shield reduce la luz azul y la pantalla extrafluida mantiene la vista relajada, ya sea que estés jugando o navegando. Todo en la amplia pantalla Infinity-O Display de 6,5 pulgadas.</p><br><p>UN NUEVO ESTÁNDAR PARA UN DISEÑO IMPRESIONANTE</p><p>Presenta curvas cómodas y elegantes en un diseño perfecto. El mínimo borde de la cámara combina con el acabado mate en la parte posterior para lograr un aspecto icónico y unificado.</p><br><p>CÁMARA ASOMBROSA, SIEMPRE NÍTIDA Y ESTABLE</p><p>El sistema de cámaras con múltiples lentes lleva las fotos al siguiente nivel. Conseguí una resolución ultraalta en la cámara principal de 64 MP con OIS para tomar fotos nítidas y claras durante todo el día. Expandí el ángulo de visión con la cámara ultraancha. Personalizá el enfoque con la cámara de profundidad o mirá los detalles de cerca con la cámara macro.</p><br><p>CON SUPER STEADY ESTARÁS SIEMPRE LISTO</p><p>En el modo Super Steady, mantiene tus videos con un aspecto fluido y estable. Graba como una cámara de acción de alta calidad, ya que utiliza la cámara ultraancha y un software predictivo.</p><br><p>CÁMARA FRONTAL DE ALTA RESOLUCIÓN, SELFIES IMPRESIONANTES</p><p>La cámara frontal de 32 MP toma selfies claras de alta resolución durante todo el día. Y con el efecto bokeh para difuminar suavemente el fondo, serás la estrella de la foto.</p><br><p>RESISTENTE A DERRAMES Y SALPICADURAS</p><p>Con la clasificación IP67 por su resistencia al agua y al polvo, este teléfono soporta hasta 1 metro de agua durante 30 minutos. Así que no te preocupes si tu teléfono se moja un poco y quieres seguir jugando o tomando fotos.</p><br><p>SONIDO ENVOLVENTE EN LA PALMA DE LA MANO</p><p>Con dos altavoces, uno en la parte superior y otro en la parte inferior, tendrás una experiencia de sonido estéreo sin tener que usar los auriculares. Disfruta una noche de películas o tus juegos favoritos con un sonido cinematográfico que te dejará en medio de la escena.</p><br><p>BATERÍA ASOMBROSA QUE DURA HASTA DOS DÍAS</p><p>Con la batería de 4500 mAh tendrás más tiempo para hacer lo que te gusta: transmitir o compartir contenido, jugar y más. La administración de energía de IA detecta y se ajusta a tus hábitos de uso móvil para ofrecerte una energía duradera. Y con una carga superrápida de hasta 25 V, vuelve a su máxima potencia rápidamente.</p><br><p>RENDIMIENTO ASOMBROSO PARA MANTENERTE EL RITMO</p><p>Ya sea que estés enfocado en una tarea o en varias tareas a la vez, ofrece un excelente rendimiento gracias a su procesador avanzado de ocho núcleos y hasta 6 GB de RAM. Almacena más y elimina menos con 128 GB de almacenamiento interno. Y, si no es suficiente, agrega hasta 1 TB con la tarjeta MicroSD.</p><br><p>GAME BOOSTER TE DA LA VENTAJA</p><p>Maximiza el rendimiento con Game Booster. Reduce las distracciones y mejora tu juego con una interfaz exclusiva y un menú de fácil acceso. Frame Booster proporciona un movimiento suave y realista de los gráficos. Juega al máximo mientras Game Booster aprende tus patrones de uso para optimizar la batería, la temperatura y la memoria.</p><br><p>PROTEGE LO QUE TE IMPORTA</p><p>Incorporado en el hardware y software del teléfono desde el principio, Samsung Knox protege tu teléfono desde el momento en que se enciende. Ofrece seguridad en varios niveles y protege tu información de malware y amenazas maliciosas.</p><br><p>OPTIMIZADO PARA TU COMODIDAD</p><p>Disfruta de un movimiento suave y un diseño asombroso con One UI. Está optimizado para cualquier tamaño de pantalla y te permite concentrarte en lo importante de una manera cómoda e intuitiva. One UI te permite personalizar tu teléfono para que se adapte a tus gustos y que puedas disfrutar plenamente de tu cómoda experiencia Galaxy.</p><br><br><p>- Procesador: Octa-Core Snapdragon 720G 2.3 GHz</p><p>- Sistema operativo: Android 11 (One UI 3.1)</p><p>- Memoria RAM: 6 GB</p><p>- Almacenamiento: 128 GB (102,2 GB disponibles)</p><p>- Expansión de almacenamiento: MicroSD hasta 1 TB</p><p>- Pantalla: Super AMOLED 6.5\" (164 mm) FHD+ (1080 x 2400 px)</p><p>- Cámaras:</p><p>-- Trasera: 64 MP + 12 MP + 5 MP + 5 MP con autofoco, flash y OIS</p><p>-- Frontal: 32 MP</p><p>-- Zoom digital: Trasera, hasta 10x</p><p>- Ranura SIM: Nano-SIM 4FF</p><p>- Conectividad:</p><p>-- Redes 2G / 3G / 4G LTE</p><p>-- WiFi 802.11a/b/g/n/ac 2.4 & 5 GHz</p><p>-- Bluetooth 5.0</p><p>-- NFC</p><p>-- USB Type-C 2.0 OTG</p><p>-- GPS (Glonass, Beidou, Galileo)</p><p>-- Salida auxiliar 3.5 mm</p><p>- Sensores: Acelerómetro, giroscopio, geomagnético, iluminación, proximidad, huella dactilar</p><p>- Batería: Li-Po de 4500 mAh no removible</p><p>- Autonomía:</p><p>-- En uso de internet: Hasta 18 horas</p><p>-- En reproducción de video: Hasta 21 horas</p><p>-- En reproducción de audio: Hasta 127 horas</p><p>-- En conversación: Hasta 37 horas</p><p>- Dimensiones: 159,9 x 75,1 x 8,4 mm</p><p>- Peso: 189 gramos</p><br>",
